  line-height: 3rem;
  margin-bottom: 3rem;
}

/* ABOUT US PAGE */
#about-us {
  position: relative;
  height: 95vh;
  background-image: url("../images/aboutus.jpg");
  background-size: cover;
  background-position: center top;
  overflow: hidden;
}

.aboutus__box {
  position: absolute;
  color: white;
  width: 50%;
  height: 40%;
  top: 10%;
  transform: translateX(50%);

  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-around;
  text-align: center;
}

#vision {
  min-height: 75vh;
  background-color: var(--cohereRed);
}

.vision__box {
  padding: 3rem;
  color: white;
  margin: 0 auto;
  min-height: inherit;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  text-align: center;
}

#collab {
  min-height: 75vh;
  width: 100%;
  background-color: var(--cohereBlue);
}

.collaboration {
  display: flex;
  color: white;
  height: 85vh;
}

.collaboration__text {
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  padding: 4rem;
  text-align: justify;
  width: 50%;
}

.collaboration__image {
  background-image: url("../images/collab.jpg");
  background-size: cover;
  background-position: center top;
  height: 100%;
  width: 50vw;
  position: relative;
}

@media only screen and (max-width: 56.25em) {
  #collab {
    height: 100vh;
  }
  .collaboration {
    flex-direction: column;
    align-items: center;
  }
  .collaboration__image {
    display: none;
  }

  .collaboration__text {
    align-items: center;
    text-align: center;
    justify-content: space-between;
    padding: 2rem;
  }
}

/* REPORTS PAGE */
#reports {
  height: 100%;
}

.reports {
  color: var(--cohereBlack);
  padding: 5rem;
}

.reports__title {
  color: var(--cohereBlack);
  text-transform: uppercase;
  text-align: center;
}

/* CUSTOM BUTTON */
.cbutton {
  border: none;
  text-transform: uppercase;
  background-color: var(--cohereRed);
  border-radius: 6px;
  font-size: 1.6rem;
  width: 30%;
  padding: 6px;

  transition: all 0.2;
}

.cbutton:hover {
  transform: translateY(-1px);
}

/* GALLERY */
.gallery {
  display: grid;
  /* grid-template-columns: repeat(9, 1fr); */
  /* grid-template-rows: repeat(30, 5vw); */
  grid-template-columns: repeat(auto-fit, minmax(35rem, 1fr));
  grid-auto-rows: 40rem;
  gap: 15px;
}

.gallery__team {
  grid-auto-rows: 50rem !important;
  gap: 2rem !important;
}
.gallery__item {
  position: relative;
}

.gallery__img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  border-radius: 12px;

  transition: all 0.2s;
}

.gallery__item:hover .gallery__img {
  filter: brightness(0.5);
  transform: scale(1.01);
}

.gallery__description {
  position: absolute;
  font-weight: bold;
  color: white;
  top: 0;
  height: 100%;
  width: 100%;
  letter-spacing: 2px;

  display: flex;
  flex-direction: column;
  justify-content: space-between;
  padding: 2rem;
  text-overflow: ellipsis;
}

.gallery__description--team {
  position: absolute;
  opacity: 0;
  font-weight: bold;
  color: white;
  top: 0;
  height: 100%;
  width: 100%;
  letter-spacing: 2px;

  display: flex;
  flex-direction: column;
  justify-content: space-between;
  padding: 2rem;
  transition: all 0.5s;
}

.gallery__description--team p {
  font-size: 1.5rem !important;
}

.gallery__description--team i {
  font-size: 2.9rem !important;
  transition: all 0.2s;
}

.gallery__description--team i:hover {
  cursor: pointer;
  transform: translateY(-1px);
}

.gallery__item:hover .gallery__description--team {
  opacity: 1;
}

/* TEXT UTILITIES */
.u-text-mid {
  font-size: 1.6rem !important;
}

/* POSITIONING UTILITIES */
.u-center {
  margin: 0 auto !important;
}

/* PADDING UTILITIES */

/* CHEVRON ANIMATION */
@keyframes updown {
  0%,
  100% {
    transform: translateY(0);
  }
  50% {
    transform: translateY(-10px);
  }
}

/* TEXT ANIMATIONS */
@keyframes moveInLeft {
  0% {
    opacity: 0;
    transform: translateX(-10rem);
  }

  80% {
    transform: translateX(1rem);
  }

  100% {
    opacity: 1;
    transform: translate(0);
  }
}

@keyframes moveInRight {
  0% {
    opacity: 0;
    transform: translateX(20rem);
  }

  80% {
    transform: translateX(1rem);
  }

  100% {
    opacity: 1;
    transform: translate(0);
  }
}

@keyframes moveInBottom {
  0% {
    opacity: 0;
    transform: translateY(3rem);
  }

  100% {
    opacity: 1;
    transform: translate(0);
  }
}
